    def state_verification(self):
        correct_rows  = []

        if self.comboBox.currentIndex() != -1:
                if self.comboBox_2.currentIndex() != -1:
                        correct_rows.append((self.comboBox.currentText(), self.comboBox_2.currentText(), 
                        self.textEdit.toPlainText()))
                else:
                        return False, correct_rows

        if self.comboBox_3.currentIndex() != -1:
                if self.comboBox_4.currentIndex() != -1:
                        correct_rows.append((self.comboBox_3.currentText(), self.comboBox_4.currentText(), 
                        self.textEdit_2.toPlainText()))
                else:
                        return False, correct_rows

        if self.comboBox_5.currentIndex() != -1:
                if self.comboBox_6.currentIndex() != -1:
                        correct_rows.append((self.comboBox_5.currentText(), self.comboBox_6.currentText(), 
                        self.textEdit_3.toPlainText()))
                else:
                        return False, correct_rows

        if self.comboBox_8.currentIndex() != -1:
                if self.comboBox_7.currentIndex() != -1:
                        correct_rows.append((self.comboBox_8.currentText(), self.comboBox_7.currentText(), 
                        self.textEdit_4.toPlainText()))
                else:
                        return False, correct_rows

        if self.comboBox_9.currentIndex() != -1:
                if self.comboBox_10.currentIndex() != -1:
                        correct_rows.append((self.comboBox_9.currentText(), self.comboBox_10.currentText(), 
                        self.textEdit_5.toPlainText()))
                else:
                        return False, correct_rows

        if len(correct_rows) == 0:
                return False, correct_rows
        else:
                return True, correct_rows

    def create_message(self, all_conflicts):
        temp_string = ""
        for i in all_conflicts:
                temp_string += (i[0] + ': ' + i[1] + ' & ' + i[2] + '\n') 

        return temp_string

    def display_status(self, all_conflicts):
        msg = QMessageBox()
        msg.setWindowTitle("Conflicts")
        msg.setStandardButtons(QMessageBox.Ok | QMessageBox.Cancel)
        if len(all_conflicts) > 0:
                message_content = self.create_message(all_conflicts)
                msg.setIcon(QMessageBox.Warning)
                msg.setDetailedText("Following conflict(s) detected:\n" + message_content)
                msg.setText("Incorrect schedule!")
        else:
                msg.setIcon(QMessageBox.Information)
                msg.setDetailedText("No conflicts found")
                msg.setText("Correct schedule!")
        msg.exec_()

    def conflicts(self):
        check, rows = self.state_verification()

        if check: # no issues in selection
                all_conflicts = check_conflict(rows)
                self.display_status(all_conflicts)
        else:
                msg = QMessageBox()
                msg.setIcon(QMessageBox.Warning)
                msg.setWindowTitle("Error")
                msg.setStandardButtons(QMessageBox.Ok | QMessageBox.Cancel)
                msg.setDetailedText("Cannot perform check on incomplete/empty selections.")
                msg.setText("Cannot perform check!")
                msg.exec_()

