    def extract_data(self):
        r1 = (self.comboBox.currentText(), self.comboBox_2.currentText())
        r2 = (self.comboBox_3.currentText(), self.comboBox_4.currentText())
        r3 = (self.comboBox_5.currentText(), self.comboBox_6.currentText())
        r4 = (self.comboBox_8.currentText(), self.comboBox_7.currentText())
        r5 = (self.comboBox_9.currentText(), self.comboBox_10.currentText())

        data_lst = [r1, r2, r3, r4, r5]
        return data_lst

    def save_selection(self):
        file_name = str(datetime.datetime.now().strftime("%Y-%m-%d %H-%M-%S")) + ".txt"
        filehandle = open(file_name, "w")
        data = self.extract_data()

        for i in range(5):
                filehandle.write("Selection {} - Course= {}; Section= {}\n".format(str(i), data[i][0], data[i][1]))

        filehandle.close()

        msg = QMessageBox()
        msg.setIcon(QMessageBox.Information)
        msg.setWindowTitle("Status")
        msg.setStandardButtons(QMessageBox.Ok | QMessageBox.Cancel)
        # msg.setDetailedText("Cannot perform check on incomplete/empty selections.")
        msg.setText("Saved selections")
        msg.exec_()


